import getters from "./getters.js";
import mutations from "./mutations.js";
import actions from "./actions.js";

export default {
    namespaced: true,
    state() {
        return {
            address: 'address',
            koko: 'koka',
            addressData: 'kolalla',
            addresses: null,
            newData: null,
        }
    },
    getters,
    mutations,
    actions,
}
